mapper.select:

select 

from TBL_URI01_TSYUSI
where Jigyosho_Code = #{jigyoshoCode,jdbcType=CHAR}
  and Cain_Code = #{cainCode,jdbcType=NUMERIC}
  and Cain_Idx = #{cainIdx,jdbcType=NUMERIC}
  and Cust_Code = #{custCode,jdbcType=NCHAR}
  and Shop_Code = #{shopCode,jdbcType=NVARCHAR}
  and Cust_Den_No = #{custDenNo,jdbcType=NCHAR}
  and Cust_Den_Row = #{custDenRow,jdbcType=NUMERIC}

mapper.delete:

delete from TBL_URI01_TSYUSI
where Jigyosho_Code = #{jigyoshoCode,jdbcType=CHAR}
  and Cain_Code = #{cainCode,jdbcType=NUMERIC}
  and Cain_Idx = #{cainIdx,jdbcType=NUMERIC}
  and Cust_Code = #{custCode,jdbcType=NCHAR}
  and Shop_Code = #{shopCode,jdbcType=NVARCHAR}
  and Cust_Den_No = #{custDenNo,jdbcType=NCHAR}
  and Cust_Den_Row = #{custDenRow,jdbcType=NUMERIC}
